import React, { useState } from "react";
import "./Title.css";
import hamburgerIcon from "../../images/hamburgerIcon.png";

const Title = ({ titleText, openCloseMenu }) => {
  return (
    <div className="title-text title-div" onClick={openCloseMenu}>
      <img className="icon" src={hamburgerIcon} />
      <div>{titleText}</div>
      <div></div>
    </div>
  );
};

export default Title;
